import axios from 'axios';
import { v1 as uuidv1 } from 'uuid';

interface QueueMessage {
  [key: string]: string[];
}

interface Sessions {
  [key: string]: string;
}

interface SlackApiResult {
  ok: boolean;
  error?: string;
  ts?: string;
}

interface SlackMessage {
  channel: string;
  text: string;
  ts?: string;
}

interface SlackMessageResponse {
  messages: SlackMessage[];
}

interface SlackApiError {
  response: {
    error: string;
  };
}

const queue_message: QueueMessage = {};
const sessions: Sessions = {};

async function send_message_to_channel(
  channel_id: string,
  message_text: string = '',
  session_id: string = 'g01'
): Promise<string> {
  try {
    const SLACK_USER_TOKEN = process.env.SLACK_USER_TOKEN;
    if (!SLACK_USER_TOKEN || SLACK_USER_TOKEN.slice(0, 4) !== 'xoxp') {
      return 'USER_TOKEN';
    }
    let is_new_session = false;
    const uniq_ID = message_text + uuidv1().slice(0, 8);

    if (!queue_message[session_id]) {
      queue_message[session_id] = [uniq_ID];
    } else {
      queue_message[session_id].push(uniq_ID);
    }

    // ID
    while (
      queue_message[session_id] &&
      uniq_ID in queue_message[session_id] &&
      queue_message[session_id].indexOf(uniq_ID) > 0
    ) {
      console.log(`... ${session_id} 1 ...`);
      await new Promise((resolve) => setTimeout(resolve, 1000));
    }
    if (!queue_message[session_id] || !queue_message[session_id].includes(uniq_ID)) {
      return '';
    }
    // IDIDtime stamp, 
    if (!sessions[session_id]) {
      is_new_session = true;
      const result = await send_message(channel_id, message_text);
      if (!result.ok) {
        // 
        pop_message(session_id, uniq_ID);
        return result.error || '';
      }
      sessions[session_id] = result.ts || '';
    } else {
      const result = await send_message(channel_id, message_text, sessions[session_id]);
      if (!result.ok) {
        // 
        pop_message(session_id, uniq_ID);
        return result.error || '';
      }
    }
    // time stamp
    const ts = sessions[session_id];
    // _Typing_
    let response = '_Typing_';
    let poped_item: string | undefined = undefined;
    // ,
    let start_time = Date.now();
    let retries = 1;
    // _Typing_
    while (response.trim().endsWith('_Typing_')) {
      const replies = await receive_message(channel_id, ts, uniq_ID);
      // replies['ok']False1
      if (!replies) {
        // 
        pop_message(session_id, uniq_ID);
        throw new Error('Claude');
      }
      if (!replies.ok || (Date.now() - start_time > 10000 && replies.messages.length <= 1)) {
        if (replies.error === 'ratelimited') {
          console.log(` 5...`);
          await new Promise((resolve) => setTimeout(resolve, 5000));
          continue;
        }
        // {max_retries}
        // @Claude
        if (retries >= 3) {
          // 
          pop_message(session_id, uniq_ID);
          return `3Claude`;
        } else {
          // {max_retries}@Claude
          console.log(` ${retries} ... : 3 `);
          await update_message(channel_id, ts, message_text);
          start_time = Date.now();
          retries += 1;
          continue;
        }
      }
      if (replies.messages.length <= 1) {
        continue;
      }
      for (let index = 1; index < replies.messages.length; index++) {
        const message = replies.messages[index];
        if (message.user !== claude_id) {
          continue;
        }
        response = message.text;
        if (
          index < replies.messages.length - 1 &&
          (replies.messages[index + 1].text.includes('*Please note:*') ||
            replies.messages[index + 1].text.includes('Oops! Claude was un'))
        ) {
          await client.chat_delete({
            channel: channel_id,
            ts: replies.messages[replies.messages.length - 1].ts,
            as_user: true,
          });
        }
        pop_message(session_id, uniq_ID, !is_new_session && !wait_til_message_finish);
        break;
      }
      await new Promise((resolve) => setTimeout(resolve, 1000));
    }
    // 
    pop_message(session_id, uniq_ID, is_new_session || wait_til_message_finish);
    return response;
  } catch (e) {
    console.log(`Error posting message to channel ${channel_id}: ${e}`);
    // 
    pop_message(session_id, uniq_ID);
    if ((e as SlackApiError).response) {
      return (e as SlackApiError).response.error || '';
    } else {
      return e.toString();
    }
  }
}

async function send_message(
  channel_id: string,
  message_text: string,
  ts?: string
): Promise<SlackApiResult> {
  const url = 'https://slack.com/api/chat.postMessage';
  const headers = {
    'Content-Type': 'application/json',
    Authorization: `Bearer ${process.env.SLACK_USER_TOKEN}`,
  };
  const data: SlackMessage = {
    channel: channel_id,
    text: message_text,
  };
  if (ts) {
    data.ts = ts;
  }
  const response = await axios.post(url, data, { headers });
  return response.data;
}

async function update_message(
  channel_id: string,
  ts: string,
  message_text: string
): Promise<SlackApiResult> {
  const url = 'https://slack.com/api/chat.update';
  const headers = {
    'Content-Type': 'application/json',
    Authorization: `Bearer ${process.env.SLACK_USER_TOKEN}`,
  };
  const data: SlackMessage = {
    channel: channel_id,
    text: message_text,
    ts: ts,
  };
  const response = await axios.post(url, data, { headers });
  return response.data;
}

async function receive_message(
  channel_id: string,
  ts: string,
  uniq_ID: string
): Promise<SlackMessageResponse | null> {
  const url = `https://slack.com/api/conversations.history?channel=${channel_id}&oldest=${ts}`;
  const headers = {
    'Content-Type': 'application/json',
    Authorization: `Bearer ${process.env.SLACK_USER_TOKEN}`,
  };
  const response = await axios.get(url, { headers });
  if (!response.data.ok) {
    return null;
  }
  if (queue_message[channel_id] && !queue_message[channel_id].includes(uniq_ID)) {
    return null;
  }
  return response.data;
}

function pop_message(session_id: string, uniq_ID: string, pop_queue: boolean = true) {
  if (pop_queue && queue_message[session_id] && queue_message[session_id].includes(uniq_ID)) {
    const index = queue_message[session_id].indexOf(uniq_ID);
    queue_message[session_id].splice(index, 1);
  }
}

